"""
selects partial data from the all available
"""
def getLocalSourceFor( theLocalSrc="GluGluToHToZZTo2L2Nu_M400", ffile=0, fstep=-1  ) :
    localSrc, trigMenu, isData = defineLocalSourceFor( theLocalSrc )
    prunedLocalSrc = cms.untracked.vstring()
    if(fstep<0): fstep = len(localSrc)
    lfile=ffile+fstep
    if(ffile<lfile) :
        fctr=0
        for i in localSrc :
            if(fctr>=ffile and fctr<lfile) :
                prunedLocalSrc.append( i )
            fctr+=1
    return prunedLocalSrc, trigMenu, isData
